import React, { Component } from 'react'

class SearchList extends Component {

    constructor(props){
        super(props);
    };
    render() {
        console.log(this.props.searchData);
        return (
            <div>
            {
                this.props.searchData.map((item) => {
                   return (
                       <div>
                            { item.id}
                       </div>
                   )
                })
            }
            </div>
        )
    }
}

export default SearchList;
